/* WriteDrawer.jsx */
import React from 'react';
import {observer} from 'mobx-react';
import Net from 'scripts/net';

import BottomDrawer from 'components/drawers/BottomDrawer';
import thumbSrc from 'images/ic-thumb@3x.png';
import checkSrc from 'images/ic-check@3x.png';
import previewSrc from 'images/img-preview-holder@3x.png';

class WriteDrawer extends BottomDrawer {

    constructor(props) {
        super(props);

        this.state = {
            base64Img: null,
        }
    }

    handleChange(event) {
        this.setState({content: event.target.value});
    }


    selectPicture() {
        if( navigator.camera ) {
            // let gettedPicture = (base64) => this.gettedPicture(base64);
            // let failedPicture = (msg) => this.failedPicture(msg);

            navigator.camera.getPicture(
                (base64) => this.gettedPicture(base64),
                (msg) => this.failedPicture(msg),
                {
                    quality: 100,
                    sourceType: 0,
                    destinationType: 0
                });

        }else{
            this.gettedPicture( sample64 );
        }
    }

    gettedPicture(base64) {

        this.setState({
            base64Img: 'data:image/jpeg;base64,' + base64
        }, ()=>{

            Net.uploadImg(this.state.base64Img, data => {
                this.imgId = data.postFileIdx;
            });

        });

        // {
        //     "postFileIdx": 3,
        //     "postIdx": 0,
        //     "usrId": 0,
        //     "host": null,
        //     "mimeType": "image/png",
        //     "fileName": null,
        //     "filePath": "origin/article/1519456812764.png",
        //     "delYn": "N",
        //     "regDttm": "2018-02-24 16:20:13.0",
        //     "updDttm": "2018-02-24 16:20:13.0",
        //     "post": null,
        //     "originPath": "/postFiles/3",
        //     "smallPath": "/postFiles/3/s/",
        //     "mediumPath": "/postFiles/3/m/",
        //     "largePath": "/postFiles/3/l/"
        // }
    }

    failedPicture(message) {
        alert(message);
    }

    clearPicture() {
        this.setState({
            base64Img: null,
        });
    }

    complete() {
        let data = {
            postType: "feed",
            content: this.state.content,
            postFiles: []
        };

        if( this.imgId )
            data.postFiles.push( this.imgId );

        console.log( 'complete:', data );

        Net.makePost(data, () => {
            this.props.close();
        });
    }

    render() {

        return <div>

            <section className="cl-write-section dialogs__content cl-shrink">

                <textarea name="" id="" cols="30" rows="5" placeholder="새로운 글을 작성해 보세요." value={this.state.content}
                          onChange={event => this.handleChange(event)}/>


                <footer className="cl-flex-between">

                    {this.state.base64Img&&
                        <div className="cl-preview-holder">
                            <img src={this.state.base64Img || previewSrc} alt="이미지 미리보기" width="52" height="52"/>
                            <button onClick={() => this.clearPicture()}>이미지 삭제</button>
                        </div>
                    }

                    <button className="cl-flex" onClick={()=> this.selectPicture()} >
                        <img src={thumbSrc} width="26" height="26" className="mr-03em opacity-50" alt="이미지 추가"/>
                        <span>{ this.state.base64Img?"이미지 변경":"이미지 추가"}</span>
                    </button>

                    <button className="cl-flex" onClick={()=> this.complete()} >
                        <img src={checkSrc} width="28" height="28" className="mr-03em" alt="완료"/>
                        <span className="color-primary">완료</span>
                    </button>

                </footer>

            </section>
        </div>
    }
}

export default observer(WriteDrawer);



const sample64 = "\n";
